import axios from '../../axios-orders';

const api = () => {
    const fetchAPI = () => {
        let data = null
        axios.get('https://portal-tech-react-default-rtdb.firebaseio.com/requestCompany.json')
            .then(response => this.data = response.data)
            .catch(error => console.log(error));
        return JSON.stringify(data)
    }

    return(
        <p>{toString(fetchAPI)}</p>
    )
};

export default api;
